import './App.css';
import Experience from './experience/Experience'
import About from "./pages/About"
import Projects from "./pages/Projects"

function App() {
  return (
    <div className="App">
      <Route path="/" element={<About />} />
      <Route path="/projects" element={<Projects />} />
      <Experience/>
   </div>
  );
}

export default App;
